INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(1, 'White Couch', NULL, , 1, 'This beautiful couch is perfect for the family looking for a comfortable place to sit while enjoying games, movies, or having company over. The upholstery is like-new, with no stains and discoloration.', 69.99);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(2, 'Sun Valley Sandstone Gray 6 Piece Dining Room Set', NULL, , 3, 'This 6 piece dining set is one to own! With its clean lines, stylish look and neutral finish, this set is a great addition to your home, especially if you are tight on space. Includes table, bench and four side chairs. ', 100.95);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(3, 'Chocolate Brown Patio Loveseat Glider', NULL, , 4, 'Make the most out of summer with this chocolate brown patio loveseat glider. With an aluminum frame and weather proof mesh fabric, this glider is perfect for your outdoor living space.', 120.50);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(4, 'Mason Natural and Black Executive Desk', NULL, , 5, 'Storage and style come easy with this executive desk! The natural wood grain is accented by the black framing and hardware. Keep your home office supplies organized with five utility drawers, two locking file cabinets, and a spacious desktop.', 450.50);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(5, 'Atwater Living Reeta Twin over Futon Metal Bunk Bed', NULL, , 6, 'Versatile and trendy, the Reeta Twin over Futon Metal Bunk Bed grants all your wishes. It brings a modern industrial style with its sleek lines and metal frame while still ensuring the safety of your kids. Built with sturdy metal, full-length guardrails, metal slats, a ladder and a childproof mechanism for the futon, the Reeta is the exemplification of strong and durable.', 150.00);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(6, 'LG 26.2 cu ft French Door Refrigerator - Stainless Steel ', NULL, , 2, 'Stock-up and store everything you need with this stainless steel LG French door refrigerator from RC Willey. With a cavernous 26 cubic feet of space, this LG French Door refrigerator gives you ample space for all of your familys favorite foods and keeps them conveniently organized and within reach. The LG Stainless Steel Series combines stainless steel with a satin-smooth, sophisticated finish for a brilliantly appealing look that pairs beautifully with any style.', 150.00);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(7, 'Clonmel Gray Wide Seat Recliner ', NULL, , 1, 'Add the ultimate comfort to your living room with the Clonmel collection wide recliner from RC Willey. The soft fabric and plushy cushions provide the ultimate seating for watching a movie or reading a book. With a corner blocked wood frame and metal reinforced seats, you know this recliner is built to last. ', 150.00),
(8, 'Orlando Farmhouse Sand and Black 5 Piece Dining Set', NULL, , 3, 'A trestle base and clean lines are the hallmarks of this farmhouse sand and black 5 piece dining set, now at RC Willey! The sand and black finishes complement the look that will look fantastic in any dining area, especially an eat-in kitchen. The table measures 78\" providing plenty of space to seat six. ', 0.00);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(9, 'Jordan Black Jeep Twin Bed ', NULL, , 7, 'The Jordan collection black Jeep twin bed will help your child ride the open terrain of their imagination in style and RC Willey has it! This fun and whimsical bed features a sleek, black finish adorned with realistic racing decals along the sides. Plus, its headlights actually light up! Its four tires complete the look, adding eye-catching detail and whimsy. Your child is sure to love the adventure and excitement this Jeep twin bed offers!', 215.50),
(10, 'Bicycle Unicycle Counter Height Stool ', NULL, , 2, 'This one-of-a-kind 25\" unicycle counter height stool is sure to catch the eye of all who see it. Complete with old-fashioned metal pedals and a wide sturdy base, this counter stool will keep you perched in comfort and will have you feeling like a genuine top hat wearing unicycle rider at a county fair. Whether your home\'s style is traditional or contemporary you can incorporate this statement piece for some vintage flair. ', 90.99),
(11, 'Vapor Blue Gaming Chair ', NULL, , 5, 'This Vapor Collection blue gaming chair is the perfect chair for gaming sessions both long and short. This chair features a modern design and is both stylish and functional. The adjustable chair height works for you, padded armrests, and lumbar support keeps you comfortable and free of distractions. Bring it home today and get in the game! ', 140.63);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(12, 'Metal Wicker Outdoor Hanging Chair with Cushion ', NULL, , 4, 'Featuring a suspended design and metal wicker frame, this hanging patio chair from RC Willey is perfect for lounging in your outdoor patio area. Unwind this summer in a comfortable hanging chair with a weather-resistant cushion and pad. ', 300.00);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(13, 'Heartland Antique White Nightstand ', NULL, , 6, 'The Heartland antique white nightstand at RC Willey beautifully blends a classic silhouette with country charm that results in an enduring, airy look you and your family are sure to love! This well designed piece features 1 drawer and 2 open shelves that help keep your bedside items organized and tidy. Constructed from rubberwood solids and cathedral oak veneers, its delightful antique white finish is artfully enhanced with a contrasting top. You\'ll adore its timeless design elements, convenient storage, and fresh, shabby-chic vibe that will effortlessly enhance your unique decorating style.', 190.50);
INSERT INTO `items` (`ItemId`, `Name`, `Featured`, `Img`, `CategoryId`, `Description`, `Price`) VALUES
(14, 'Pleasanton Contemporary Wine Cabinet', NULL, , 3, 'Add a chic contemporary appeal to your dining room with the Pleasanton wine cabinet. Its flawless, sturdy construction creates an organized piece that features five stemware racks, a center wine rack that holds up to seven standard sized bottles, and a bottom shelf for dinnerware. Two side cabinets open to reveal two more shelves for additional wine bottle or dinnerware storage.', 150.93),
(15, 'Gray and Walnut Wood Home Office Desk', NULL, , 5, 'Create a beautiful workspace you can call your own with the Archer Desk by LumiSource for sale online at RC Willey. Featuring a walnut wood frame, grey wood top, this two-tier contemporary design is perfect for keeping your space organized and getting work done. Perfect for large or small spaces and available in a variety of finishes, choose the one that suits your space the best.', 125.99),
(16, 'Nash Rustic Gray Upholstered Dining Room Chair', NULL, , 3, 'Upholstered for comfort and full of rustic charm, this dining room chair features a unique back design and clean lines. This chair features a durable upholstered seat and a sturdy build. Pair it with the Nash Collection dining table to complete the look.', 110.55);

